    <script>$.material.init()</script>
    <script>
        $(function () {
            Highcharts.setOptions({
               global: {
                   useUTC: false
               }
            });
            Highcharts.chart('servers-graph', {
                chart: {
                    zoomType: 'x'
                },
                title: {
                    text: 'Server Statistics'
                },
                xAxis: {
                    type: 'datetime',
                    visible: false
                },
                yAxis: {
                  title: {
                      text: 'Players'
                  }
                },
                labels: {
                    items: [{
                        html: 'Server Popularity',
                        style: {
                            left: '73px',
                            top: '18px',
                            color: (Highcharts.theme && Highcharts.theme.textColor) || 'black'
                        }
                    }]
                },
                tooltip: {
                    pointFormat: '{series.name} with <b>{point.y:,.0f}</b><br/>players'
                },
                series: [
                    <?php foreach ($s_request as $k => $v) {
                        $x = [];
                        $v = explode(';', $v);
                        $pie[$i]['host'] = $k;
                        $pie[$i]['data'] = 0;
                        foreach ($v as $w) {
                            $y = explode(',', $w);
                            $pie[$i]['data'] += $y['1'];
                            $x[] = $y;
                        } ?>
                {
                    type: 'area',
                    name: '<?= $k; ?>',
                    turboThreshold: 0,
                    data: <?= json_encode($x, JSON_NUMERIC_CHECK); ?>,
                    marker: {
                        lineWidth: 2,
                        lineColor: Highcharts.getOptions().colors[<?= $i; ?>],
                        fillColor: 'white'
                    }
                }, <?php $i++; } ?> {
                    type: 'pie',
                    name: 'Monthly Population',
                    data: [
                        <?php foreach ($pie as $pd) { ?>
                        {
                        name: '<?= $pd['host']; ?>',
                        y: <?= $pd['data']; ?>,
                        color: Highcharts.getOptions().colors[<?= $i; ?>]
                    }, <?php $i++; } ?>
                    ],
                        tooltip: {
                            pointFormat: 'Occupied <b>{point.percentage:,.0f}</b>% of monthly traffic'
                        },
                    center: [100, 80],
                    size: 100,
                    showInLegend: false,
                    dataLabels: {
                        enabled: false
                    }
                }]
            });
        });


    </script>
